import React, { Component } from 'react';
import { Rnd } from 'react-rnd';

class JSONcontainer extends Component {
    render() {
        let wireframe = this.props.wireframe;
        let controls = wireframe.controls
        return(
            <Rnd id="JSONcontainer" className="white container" bounds="parent" default={{width: controls.width/10, height: controls.height/10, x: 0, y: 0}} style={{position: "relative"}}>
                {controls && controls.map((controls) => {
                    if(controls.type === "label"){
                        console.log(controls.text);
                        return (<Rnd id="label" className="btn-large-flat" default={{height: controls.height/10, width: controls.width/10, x: controls.top/10, y: controls.left/10,}} style={{textAlign: "center", 
                            background: controls.background, 
                            borderColor: controls.bordercolor,
                            borderWidth: controls.borderwidth/10,
                            fontSize: controls.fontsize/10,
                            }}>{controls.text}</Rnd>)
                    }
                })}
            </Rnd>
        )
    }
}

export default (JSONcontainer)
